import React from 'react';
import logo from '../img/logo.png';

class Header extends React.Component {
  render() {
    return (
      <header className='header'>
          <img src={logo} alt='logo' className='headerlogo' width="200" height="auto" />
        </header>
    )
  }
}

export default Header;
